import React from "react";
import './../css/header.css';
import {Link} from "react-router-dom";
export class Header extends React.Component{
    constructor() {
        super();
        this.state = {
            show_sifaris_sub_title:false,
        }
    }
    render() {
        return (
            <div id="header">
                <div id="logo">
                    <img src={require('../files/emblem_logo.png').default}/>
                </div>
                <div id="title">
                    <span>थासाङ गाउँपालिका</span>
                    <span>गाउँकार्यपालिकाको कार्यालय</span>
                    <span>कोबाङ, मु्स्ताङ </span>
                </div>
                <div id="nav">
                    <div className="item">
                        <Link to='/project_entry'><div id="title">होम</div></Link>
                    </div>
                    <div className="item">
                        <div id="title">योजना प्रविष्टि</div>
                    </div>
                    <div className="item" onClick={()=>{this.setState({show_sifaris_sub_title:!this.state.show_sifaris_sub_title})}}>
                        <div id="title">सिफारिस पत्र</div>
                        {this.state.show_sifaris_sub_title ?
                        <div id="sub-title">
                            <div className="item">खाता संचालन सिफारिस</div>
                            <div className="item">खाता बन्द सिफारिस</div>
                        </div> : null}
                    </div>
                    <div className="item">
                        <div id="title">प्रतिवेन</div>
                    </div>
                    <div className="item">
                        <div id="title">सेटिङ</div>
                    </div>
                </div>
            </div>
        );
    }
}
